			shellScript = "# Symlink alchemy sdk to xcode workspace build directory\nimport shutil, os\n\nPREBUILT_DIR = os.environ[\"PREBUILT_DIR\"]\nALCHEMY_PRODUCT_DIR = os.path.realpath(os.environ[\"ALCHEMY_PRODUCT_DIR\"])\nALCHEMY_SDK_DIR = os.path.join(ALCHEMY_PRODUCT_DIR, \"sdk\", \"usr\")\nALCHEMY_RES_DIR = os.path.join(ALCHEMY_PRODUCT_DIR, \"staging\")\n\nos.makedirs(PREBUILT_DIR, exist_ok=True)\n\ndef link(d, sdk=True):\n    src = os.path.join(ALCHEMY_SDK_DIR if sdk else ALCHEMY_RES_DIR, d)\n    dest = os.path.join(PREBUILT_DIR, d)\n    if os.path.exists(dest) and not os.path.islink(dest):\n        shutil.rmtree(dest)\n    if not os.path.islink(dest):\n        print(\"Symlinking {} to {}\".format(src, dest))\n        os.symlink(src, dest)\n\nlink(\"include\")\nlink(\"lib\")\nlink(\"etc\", sdk=False)";
